BeerMe é um sistema de autosserviço de bebidas que traz mais conforto e comodidade para os usuários. Sem a necessidade de garçons, o cliente pode carregar créditos em sua conta, escolher qual torneira de chope quer abrir e se servir na quantidade desejada. Sem filas e de forma rápida.

Beber nunca foi tão bom!

Com BeerMe você pode:

- Adicionar créditos nos estabelecimentos que possuem nosso sistema instalado;
- Abrir a torneira e servir seu próprio chope;
- Consultar todos os consumos realizados;
- Consultar saldo disponível em cada estabelecimento;
- Consultar recargas realizadas.

Experimente a liberdade com BeerMe!
